// SPDX-License-Identifier: UNLICENSED
pragma solidity ^0.8.15;

import "hardhat/console.sol";

contract SupplyChain {

    struct OrderDetails{
        uint256 container;
        string dateOfDept;
        string placeOfDept;
        string expectArrivalDate;
        string expArrivalLocation;
        string dateUnloaded;
        string locationUnloaded;
        uint256 vessel;
        uint256 voyage;
        uint256[] upc;
        uint256[] shippedCartoons;
    }
    mapping(uint256 => OrderDetails) public containerDetail;

    function generateOrder(
        uint256 _container, 
        string memory _dateOfDept, 
        string memory _placeOfDept, 
        string memory _expDateOfArrival, 
        string memory _expLocationOfArrival, 
        uint256 _vessel, 
        uint256 _voyage, 
        uint256[] memory _upc, 
        uint256[] memory _shippedCartoon
        ) public{
            OrderDetails storage newContainer = containerDetail[_container];
            newContainer.container = _container;
            newContainer.dateOfDept = _dateOfDept;
            newContainer.expArrivalLocation = _placeOfDept;
            newContainer.expectArrivalDate = _expDateOfArrival;
            newContainer.placeOfDept = _expLocationOfArrival;
            newContainer.vessel = _vessel;
            newContainer.voyage = _voyage;
            newContainer.upc = _upc;
            newContainer.shippedCartoons = _shippedCartoon;
    }

    function getOrderbyContainerID(uint256 _containerID) public view returns (string memory, string memory, string memory, string memory, uint256, uint256, uint256[] memory, uint256[] memory){
        OrderDetails storage thisContainer = containerDetail[_containerID];
        return (thisContainer.dateOfDept, thisContainer.placeOfDept, thisContainer.expectArrivalDate, thisContainer.expArrivalLocation, thisContainer.vessel, thisContainer.voyage, thisContainer.upc, thisContainer.shippedCartoons);
    } 

    function containerUnload(uint256 _containerID, string memory _dateUnloaded, string memory _locationUnloaded ) public {
        OrderDetails storage thisContainer = containerDetail[_containerID];
        thisContainer.dateUnloaded = _dateUnloaded;
        thisContainer.locationUnloaded = _locationUnloaded;
    }
}

